CREATE  FUNCTION `get_lokasi`(_id_kode_lokasi int) RETURNS varchar(100) CHARSET latin1
BEGIN
	declare _pengguna varchar(10);
    declare _kuasa_pengguna varchar(10);
    declare _sub_kuasa_pengguna varchar(10);
    declare _instansi varchar(100);
    declare _output varchar(50);

    select  pengguna, kuasa_pengguna, sub_kuasa_pengguna, instansi into _pengguna,_kuasa_pengguna, _sub_kuasa_pengguna, _instansi
    from tbl_kode_lokasi
    where id_kode_lokasi=_id_kode_lokasi;

	if _sub_kuasa_pengguna <> '*' then
		 set _output= concat_ws(' - ',concat_ws('.',_kuasa_pengguna,_sub_kuasa_pengguna),_instansi);
    elseif _kuasa_pengguna <> '*' then
		set _output= concat_ws(' - ',_kuasa_pengguna,_instansi);
    elseif _pengguna <> '*' then
		set _output= concat_ws(' - ',_pengguna,_instansi);
    end if;

RETURN _output;
END ;;
DELIMITER ;
