CREATE  FUNCTION `get_register`(_id_kode_lokasi varchar(50),_id_kode_barang varchar(50), _tahun varchar(4)  ) RETURNS varchar(50) CHARSET latin1
BEGIN
	DECLARE _nomor_register varchar(5);
    declare int_register int;

	select nomor_register into _nomor_register
    from (
		select A.nomor_register, A.id_kode_lokasi, A.id_kode_barang, A.tanggal_perolehan
		from view_kib A
		union
		select B.nomor_register, B.id_kode_lokasi, B.id_kode_barang, B.tanggal_perolehan
		from view_kib_histori B) AB
    where id_kode_lokasi=_id_kode_lokasi and id_kode_barang=_id_kode_barang and year(tanggal_perolehan)=_tahun
    order by nomor_register desc
    limit 1

    ;

    set int_register = cast(ifnull(_nomor_register,'0') as unsigned)+1;

	return LPAD(CONVERT(int_register , char(5)),5,'0');
    -- return cast(int_register as char(4));
    -- return  _nomor_register;


END ;;
DELIMITER ;
