CREATE  FUNCTION `set_intra_extra`(kode_lokasi varchar(50), intra_extra varchar(50)) RETURNS varchar(50) CHARSET latin1
BEGIN
	set @kode_pemilik = substring(kode_lokasi, 1,3);
	set @kode_ori_kode_lokasi = substring(kode_lokasi, 6,50);
	set  @return_ = concat(@kode_pemilik, intra_extra,@kode_ori_kode_lokasi) ;
RETURN @return_;
END ;;
