CREATE  PROCEDURE `proc_filter_rekap_inventaris`(_id_user int, _id_pemilik int,_id_kode_lokasi int, _start_date varchar(20), _last_date varchar(20), _kode_intra_extra varchar(2))
BEGIN
DROP TEMPORARY TABLE if exists temp_tbl_kib;
CREATE TEMPORARY TABLE temp_tbl_kib
    SELECT
         B.kode_jenis,
         `tbl_kib_a`.`id_kib_a` AS `id_kib`,
        `tbl_kib_a`.`id_pemilik` AS `id_pemilik`,
        `tbl_kib_a`.`id_kode_lokasi` AS `id_kode_lokasi`,
        `tbl_kib_a`.`id_kode_barang` AS `id_kode_barang`,
        `tbl_kib_a`.`tanggal_perolehan` AS `tanggal_perolehan`,
        `tbl_kib_a`.`harga` AS `harga`
    FROM
        `tbl_kib_a`
    left join tbl_master_jenis B on B.kode_jenis=1
    WHERE
        (`tbl_kib_a`.`validasi` = 2) and status_barang not in ('penghapusan_diterima','terhapus')
    UNION ALL SELECT
        B.`kode_jenis`,
        `tbl_kib_b`.`id_kib_b` AS `id_kib`,
        `tbl_kib_b`.`id_pemilik` AS `id_pemilik`,
        `tbl_kib_b`.`id_kode_lokasi` AS `id_kode_lokasi`,
        `tbl_kib_b`.`id_kode_barang` AS `id_kode_barang`,
        `tbl_kib_b`.`tanggal_perolehan` AS `tanggal_perolehan`,
        `tbl_kib_b`.`harga` AS `harga`
    FROM
        `tbl_kib_b`
    left join tbl_master_jenis B on B.kode_jenis=2
    WHERE
        (`tbl_kib_b`.`validasi` = 2) and status_barang not in ('penghapusan_diterima','terhapus')
    UNION ALL SELECT
        B.`kode_jenis`,
        `tbl_kib_c`.`id_kib_c` AS `id_kib`,
        `tbl_kib_c`.`id_pemilik` AS `id_pemilik`,
        `tbl_kib_c`.`id_kode_lokasi` AS `id_kode_lokasi`,
        `tbl_kib_c`.`id_kode_barang` AS `id_kode_barang`,
        `tbl_kib_c`.`tanggal_perolehan` AS `tanggal_perolehan`,
        `tbl_kib_c`.`harga` AS `harga`
    FROM
        `tbl_kib_c`
    left join tbl_master_jenis B on B.kode_jenis=3
    WHERE
        (`tbl_kib_c`.`validasi` = 2) and status_barang not in ('penghapusan_diterima','terhapus')
    UNION ALL SELECT
        B.`kode_jenis`,
        `tbl_kib_d`.`id_kib_d` AS `id_kib`,
        `tbl_kib_d`.`id_pemilik` AS `id_pemilik`,
        `tbl_kib_d`.`id_kode_lokasi` AS `id_kode_lokasi`,
        `tbl_kib_d`.`id_kode_barang` AS `id_kode_barang`,
        `tbl_kib_d`.`tanggal_perolehan` AS `tanggal_perolehan`,
        `tbl_kib_d`.`harga` AS `harga`
    FROM
        `tbl_kib_d`
    left join tbl_master_jenis B on B.kode_jenis=4
    WHERE
        (`tbl_kib_d`.`validasi` = 2) and status_barang not in ('penghapusan_diterima','terhapus')
    UNION ALL SELECT
        B.`kode_jenis`,
        `tbl_kib_e`.`id_kib_e` AS `id_kib`,
        `tbl_kib_e`.`id_pemilik` AS `id_pemilik`,
        `tbl_kib_e`.`id_kode_lokasi` AS `id_kode_lokasi`,
        `tbl_kib_e`.`id_kode_barang` AS `id_kode_barang`,
        `tbl_kib_e`.`tanggal_perolehan` AS `tanggal_perolehan`,
        `tbl_kib_e`.`harga` AS `harga`
    FROM
        `tbl_kib_e`
    left join tbl_master_jenis B on B.kode_jenis=5
    WHERE
        (`tbl_kib_e`.`validasi` = 2) and status_barang not in ('penghapusan_diterima','terhapus')
    UNION ALL SELECT
         B.`kode_jenis`,
         `tbl_kib_f`.`id_kib_f` AS `id_kib`,
        `tbl_kib_f`.`id_pemilik` AS `id_pemilik`,
        `tbl_kib_f`.`id_kode_lokasi` AS `id_kode_lokasi`,
        `tbl_kib_f`.`id_kode_barang` AS `id_kode_barang`,
        `tbl_kib_f`.`tanggal_perolehan` AS `tanggal_perolehan`,
        `tbl_kib_f`.`nilai_kontrak` AS `nilai_kontrak`
    FROM
        `tbl_kib_f`
    left join tbl_master_jenis B on B.kode_jenis=6
    WHERE
        (`tbl_kib_f`.`validasi` = 2) and status_barang not in ('penghapusan_diterima','terhapus');

	-- cari pengguna, kuasa_pengguna, sub_kuasa_pengguna,
	select pengguna, kuasa_pengguna, sub_kuasa_pengguna into @pengguna,  @kuasa_pengguna, @sub_kuasa_pengguna
	from tbl_kode_lokasi
	where id_kode_lokasi=_id_kode_lokasi;


    -- DROP TEMPORARY TABLE if exists temp_tbl_kib_filter;
	-- CREATE TEMPORARY TABLE temp_tbl_kib_filter
    -- hapus rekapan sebelumnya
    SET SQL_SAFE_UPDATES=0;
	DELETE
	FROM tbl_temp_rekap_inventaris
	where id_user=_id_user;
    SET SQL_SAFE_UPDATES=1;

    set @query = "INSERT INTO tbl_temp_rekap_inventaris (id_user, id_kib, kode_jenis, id_pemilik, id_kode_lokasi, id_kode_barang, tanggal_perolehan, harga, value_intra_extra )";
	set @query = concat(@query," select ", _id_user ,",A.id_kib,A.kode_jenis,A.id_pemilik,A.id_kode_lokasi,A.id_kode_barang,A.tanggal_perolehan,A.harga , B.value " );
	set @query = concat(@query,
		 	"from temp_tbl_kib A
			 left join tbl_master_intra_extra B  on A.kode_jenis=B.kode_jenis
             left join tbl_kode_lokasi C on A.id_kode_lokasi = C.id_kode_lokasi ");

	set @query = concat(@query," where id_pemilik =", _id_pemilik );

    -- filter lokasi
    if @sub_kuasa_pengguna <> '*' then -- jika sub_kuasa_pengguna ada
		set @query = concat(@query," and A.id_kode_lokasi=",_id_kode_lokasi);
    elseif @kuasa_pengguna <> '*' then -- jika kuasa_pengguna ada
		set @query = concat(@query," and C.pengguna=",@pengguna," and C.kuasa_pengguna=",@kuasa_pengguna);
	elseif @pengguna <> '*' then  -- jika pengguna ada
		set @query = concat(@query," and C.pengguna=",@pengguna);
    end if;
    -- filter tanggal wal dan akhir
	if _start_date <> ""	then
		set @query = concat(@query," and tanggal_perolehan >='", _start_date,"'");
    end if;
	if _last_date <> ""	then
		set @query = concat(@query," and tanggal_perolehan <='", _last_date,"'");
    end if;

	-- filter intra extra
	if _kode_intra_extra = '01' then
		set @query = concat(@query,' and A.harga >= B.value');
    elseif _kode_intra_extra = '02' then
		set @query = concat(@query,' and A.harga < B.value');
    end if;
    set @query = concat(@query,';');
	-- select @query;
    prepare resultset from @query;
	execute resultset;
	deallocate prepare resultset;

END ;;
DELIMITER ;
