CREATE  PROCEDURE `proc_histori_barang`(_status_histori varchar(20),_id_kode_lokasi varchar(10), _kode_jenis varchar(2), _id_kib int)
proc_label:BEGIN

	-- DROP TEMPORARY TABLE if exists temp_tbl_histori;
	-- CREATE TEMPORARY TABLE temp_tbl_histori
    set @id_kode_barang=0,@harga=0, @nomor_register='';
	select id_kode_barang,harga,nomor_register into @id_kode_barang,@harga, @nomor_register
	from view_kib
	where kode_jenis=_kode_jenis and id_kib=_id_kib;

    set @row_axist=0,@jumlah_akhir=0,@harga_akhir=0;
	SELECT
		(select count(*) as count_row
        from `tbl_histori_barang` as B1
        where B1.id_kode_lokasi=A.id_kode_lokasi and B1.id_kode_barang=A.id_kode_barang
        group by B1.id_kode_lokasi, B1.id_kode_barang) as count_row,
		jumlah_akhir, harga_akhir
        into
        @row_axist,@jumlah_akhir,@harga_akhir
	FROM `tbl_histori_barang` as A
	WHERE id_kode_lokasi = _id_kode_lokasi
	AND id_kode_barang = @id_kode_barang
	ORDER BY `id_histori_barang` DESC
	LIMIT 1	;

    -- select @row_axist,@jumlah_akhir,@harga_akhir;
	-- leave proc_label;
	set @new_jumlah_akhir=0;
	set @new_harga_akhir=0;
    if @row_axist = 0 then -- belum pernah ada record
		INSERT INTO tbl_histori_barang (`tanggal_histori`, `status_histori`, `kode_jenis`, `id_kib`, `id_kode_lokasi`, `id_kode_barang`, nomor_register, `jumlah_awal`, `harga_awal`, `jumlah`, `harga`, `jumlah_akhir`, `harga_akhir`) VALUES
        (curdate(), _status_histori, _kode_jenis, _id_kib, _id_kode_lokasi, @id_kode_barang, @nomor_register, '0', '0', 1, @harga, 1, @harga);

    elseif  @row_axist <> 0 then -- sudah pernah ada record
		-- cek status histori
		if _status_histori = 'entri' or _status_histori = 'mutasi_in' then
			set @new_jumlah_akhir=@jumlah_akhir+1;
            set @new_harga_akhir=@harga_akhir+@harga;
        elseif _status_histori = 'mutasi_out' or _status_histori = 'penghapusan' then
			set @new_jumlah_akhir=@jumlah_akhir-1;
            set @new_harga_akhir=@harga_akhir-@harga;
        end if;
        /*select @harga_akhir;    select @harga;    select @new_harga_akhir;*/
		INSERT INTO tbl_histori_barang (`tanggal_histori`, `status_histori`, `kode_jenis`, `id_kib`, `id_kode_lokasi`, `id_kode_barang`, nomor_register, `jumlah_awal`, `harga_awal`, `jumlah`, `harga`, `jumlah_akhir`, `harga_akhir`) VALUES
		(curdate(), _status_histori, _kode_jenis, _id_kib, _id_kode_lokasi, @id_kode_barang, @nomor_register, @jumlah_akhir, @harga_akhir, 1, @harga, @new_jumlah_akhir, @new_harga_akhir);
    end if;



END ;;
DELIMITER ;
