CREATE  PROCEDURE `proc_laporan_mutasi`(_id_user int,_id_pemilik int,_id_kode_lokasi int, _start_date varchar(20), _last_date varchar(20), _kode_intra_extra varchar(2))
BEGIN

	-- cari pengguna, kuasa_pengguna, sub_kuasa_pengguna,
	select pengguna, kuasa_pengguna, sub_kuasa_pengguna into @pengguna,  @kuasa_pengguna, @sub_kuasa_pengguna
	from tbl_kode_lokasi
	where id_kode_lokasi=_id_kode_lokasi;


	DROP TEMPORARY TABLE if exists temp_tbl_mutasi;
	CREATE TEMPORARY TABLE temp_tbl_mutasi

	select D2.kode_lokasi, D2.instansi,A2.min_id,A2.max_id,A2.tanggal_histori, A2.status_histori, A2.id_kode_lokasi, A2.id_kode_barang,
			A2.kode_barang, A2.nomor_register,A2.nama_barang, A2.merk_type,A2.sertifikat_nomor,A2.bahan,A2.asal_usul,A2.tanggal_perolehan,A2.ukuran_barang, A2.satuan, A2.keadaan_barang,
			B2.jumlah_awal, B2.harga_awal, A2.jumlah, A2.harga, C2.jumlah_akhir, C2.harga_akhir
	from (
		select 	A.tanggal_histori, A.status_histori, A.id_kode_lokasi, A.id_kode_barang ,
				group_concat(A.nomor_register order by A.nomor_register asc) as nomor_register,
				D.kode_barang, D.nama_barang, D.merk_type, D.sertifikat_nomor, D.bahan, D.asal_usul, D.tanggal_perolehan, D.ukuran_barang, D.satuan, D.keadaan_barang,
				sum(A.jumlah) as jumlah, sum(A.harga) as harga,
				min(A.id_histori_barang) as min_id, max(A.id_histori_barang) as max_id

		from tbl_histori_barang as A
		left join view_laporan_inventaris as D on A.kode_jenis=D.kode_jenis and A.id_kib=D.id_kib

		group by A.tanggal_histori, A.status_histori, A.id_kode_lokasi, A.id_kode_barang ,
				D.kode_barang, D.nama_barang, D.merk_type, D.sertifikat_nomor, D.bahan, D.asal_usul, D.tanggal_perolehan, D.ukuran_barang, D.satuan, D.keadaan_barang

    ) as A2
	left join tbl_histori_barang as B2 on B2.id_histori_barang=min_id
	left join tbl_histori_barang as C2 on C2.id_histori_barang=max_id
	LEFT JOIN view_lokasi as D2 ON D2.id_kode_lokasi=A2.id_kode_lokasi

    where 	case when @sub_kuasa_pengguna <> '*'
					then D2.id_kode_lokasi=_id_kode_lokasi
				when @kuasa_pengguna <> '*'
					then D2.pengguna=@pengguna and D2.kuasa_pengguna=@kuasa_pengguna
				else D2.pengguna = @pengguna end
	order by A2.id_kode_lokasi,kode_barang,min_id;

/*	DROP TEMPORARY TABLE if exists temp_tbl_mutasi_2;
	CREATE TEMPORARY TABLE temp_tbl_mutasi_2 LIKE temp_tbl_mutasi;
    INSERT INTO temp_tbl_mutasi_2 SELECT * FROM temp_tbl_mutasi;
 */
	DROP TEMPORARY TABLE if exists temp_tbl_mutasi_3;
	CREATE TEMPORARY TABLE temp_tbl_mutasi_3 LIKE temp_tbl_mutasi;
    INSERT INTO temp_tbl_mutasi_3 SELECT * FROM temp_tbl_mutasi;
    /*
	select A.*, B.min_id_by_kode_barang,B.max_id_by_kode_barang
    from temp_tbl_mutasi_2 A
    left join (
		select id_kode_lokasi, id_kode_barang ,min(min_id) as min_id_by_kode_barang, max(max_id) as max_id_by_kode_barang
		from temp_tbl_mutasi_3
		group by id_kode_lokasi, id_kode_barang
        ) as B on B.id_kode_lokasi=A.id_kode_lokasi and B.id_kode_barang=A.id_kode_barang;
    */

	DROP TEMPORARY TABLE if exists temp_tbl_mutasi_4;
	CREATE TEMPORARY TABLE temp_tbl_mutasi_4 LIKE temp_tbl_mutasi;
    INSERT INTO temp_tbl_mutasi_4 SELECT * FROM temp_tbl_mutasi;

	DROP TEMPORARY TABLE if exists temp_tbl_mutasi_5;
	CREATE TEMPORARY TABLE temp_tbl_mutasi_5 LIKE temp_tbl_mutasi;
    INSERT INTO temp_tbl_mutasi_5 SELECT * FROM temp_tbl_mutasi;

    SET @row_number = 0;
    set @temp_id_lokasi=0;



    select 1 as level,'' as no, kode_lokasi, instansi ,
			'' min_id,'' max_id, '' min_id_by_kode_barang, '' max_id_by_kode_barang,
            '' tanggal_histori, '' status_histori, '' id_kode_lokasi, '' id_kode_barang,
			'' kode_barang, '' nomor_register,'' nama_barang, '' merk_type,'' sertifikat_nomor,'' bahan,'' asal_usul,'' tanggal_perolehan,'' ukuran_barang, '' satuan, '' keadaan_barang,
			'' jumlah_awal, '' harga_awal, '' jumlah, '' harga, '' jumlah_akhir, '' harga_akhir,0 as id_kode_lokasi
    from temp_tbl_mutasi_4
    group by kode_lokasi, instansi

    union all
    (
		select 2 as level,case when @temp_id_lokasi = B.id_kode_lokasi then  @row_number:=@row_number + 1 else @row_number:=1 end as no,
				 B.kode_lokasi, B.instansi ,
				 B.min_id, B.max_id, C.min_id_by_kode_barang, C.max_id_by_kode_barang,
                 B.tanggal_histori,  B.status_histori,  B.id_kode_lokasi,  B.id_kode_barang,
				 B.kode_barang,  B.nomor_register, B.nama_barang,  B.merk_type, B.sertifikat_nomor, B.bahan, B.asal_usul, B.tanggal_perolehan, B.ukuran_barang,  B.satuan,  B.keadaan_barang,
				 B.jumlah_awal,  B.harga_awal,  B.jumlah,  B.harga,  B.jumlah_akhir,  B.harga_akhir,
				 @temp_id_lokasi:=B.id_kode_lokasi
		from temp_tbl_mutasi_5 as B
		left join (
			select id_kode_lokasi, id_kode_barang ,min(min_id) as min_id_by_kode_barang, max(max_id) as max_id_by_kode_barang
			from temp_tbl_mutasi_3
			group by id_kode_lokasi, id_kode_barang
			) as C on C.id_kode_lokasi=B.id_kode_lokasi and C.id_kode_barang=B.id_kode_barang
      )
    order by kode_lokasi,kode_barang, level
	;

END ;;
DELIMITER ;
