CREATE  PROCEDURE `proc_laporan_penyusutan`(_id_user int,_id_pemilik int,_id_kode_lokasi int, _start_date varchar(20), _last_date varchar(20), _kode_intra_extra varchar(2))
BEGIN
	-- insert filter data kib ke tabel sementara
	call proc_filter_rekap_inventaris(_id_user,_id_pemilik,_id_kode_lokasi, _start_date, _last_date, _kode_intra_extra);

	SET @row_number = 0;
	select (@row_number:=@row_number + 1) AS no, jenis, id_kode_objek, nama_barang as objek,
		count(*) as jumlah_barang,
		sum(nilai_perolehan) as jumlah_harga,
		sum(nilai_penyusutan) as jumlah_nilai_penyusutan ,
		sum(akumulasi_penyusutan) as jumlah_akumulasi_penyusutan,
		sum(nilai_buku) as jumlah_nilai_buku
	from (
		select C.id_kode_barang as id_kode_objek,A.id_kode_barang, E.nama_barang as jenis, C.nama_barang, nilai_perolehan, nilai_penyusutan, akumulasi_penyusutan, nilai_buku
		from tbl_temp_rekap_inventaris A
		left join tbl_kode_barang B on A.id_kode_barang = B.id_kode_barang
		left join view_kode_barang_objek C on B.kode_akun = C.kode_akun and B.kode_kelompok = C.kode_kelompok and B.kode_jenis = C.kode_jenis and B.kode_objek = C.kode_objek
		left join view_kode_barang_jenis E on B.kode_akun = E.kode_akun and B.kode_kelompok = E.kode_kelompok and B.kode_jenis = E.kode_jenis
		left join (
			select *
			from tbl_penyusutan
			where id_user=_id_user and tanggal_penyusutan = first_day(_last_date) -- and id_kode_lokasi=11
		) as D on A.kode_jenis=D.kode_jenis and A.id_kib=D.id_kib
		where A.id_user=_id_user
	) as A1
	group by id_kode_objek;


END ;;
DELIMITER ;
