CREATE  PROCEDURE `proc_mutasi`(_id_mutasi INT(11) )
proc_label:BEGIN

	DECLARE done BOOLEAN DEFAULT FALSE;
	DECLARE _id_mutasi_barang,_id_kode_barang,
			_id_kib, _id_kode_lokasi_baru, _id_kode_lokasi_lama BIGINT UNSIGNED;

    DECLARE _kode_jenis,_tanggal_perolehan, _kode_lokasi, _kode_pemilik varchar(50);

	DECLARE cur CURSOR FOR
	  SELECT A.id_mutasi_barang
	  FROM tbl_mutasi_barang A
      left join tbl_mutasi B on A.id_mutasi=B.id_mutasi
	  WHERE A.id_mutasi=_id_mutasi and A.status_diterima=2 and B.status_validasi <> 2;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done := TRUE;

	OPEN cur;

	mutasiLoop: LOOP
	FETCH cur INTO _id_mutasi_barang;
	IF done THEN
	  LEAVE mutasiLoop;
	END IF;

	SELECT 	A.kode_jenis, A.id_kib, B.id_kode_lokasi_baru, B.id_kode_lokasi_lama, substring(C.kode_lokasi,1,2), C.id_kode_barang, C.tanggal_perolehan
			INTO
			_kode_jenis, _id_kib, _id_kode_lokasi_baru,_id_kode_lokasi_lama, _kode_pemilik, _id_kode_barang, _tanggal_perolehan
	FROM tbl_mutasi_barang A
    left join tbl_mutasi B on A.id_mutasi=B.id_mutasi
    left join view_kib C on A.kode_jenis=C.kode_jenis and A.id_kib=C.id_kib
	WHERE A.id_mutasi_barang=_id_mutasi_barang;


    select concat_ws('.',_kode_pemilik,A.kode_lokasi) into _kode_lokasi
    from view_lokasi A
    where A.id_kode_lokasi=_id_kode_lokasi_baru;

	set @sql = '';
	set @tabel='';
	set @id_kib='';
    set @tabel_histori='';
    set @column='';
	if _kode_jenis = 1 then
		set @tabel='tbl_kib_a';
		set @id_kib='id_kib_a';
        set @tabel_histori='tbl_kib_a_histori';
        set @column='id_kib_a,id_pemilik,id_kode_barang,id_kode_lokasi,nama_barang,kode_barang,nomor_register,luas,tahun_pengadaan,letak_alamat,status_hak,sertifikat_tanggal,sertifikat_nomor,penggunaan,asal_usul,harga,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,created_at,updated_at';
	elseif _kode_jenis = 2 then
		set @tabel='tbl_kib_b';
