CREATE  PROCEDURE `proc_penyusutan`(_id_user int,_tanggal_penyusutan varchar(10))
BEGIN

    SET SQL_SAFE_UPDATES=0;
	DELETE
	FROM tbl_penyusutan
	where 	-- id_user=_id_user and
			month(tanggal_penyusutan)=month(_tanggal_penyusutan) and
            year(tanggal_penyusutan)=year(_tanggal_penyusutan);
    SET SQL_SAFE_UPDATES=1;

	set @_tanggal_penyusutan=_tanggal_penyusutan,
		@_id_user=_id_user;

	INSERT INTO tbl_penyusutan (id_user, tanggal_penyusutan, kode_jenis, id_kib, id_kode_barang, id_kode_lokasi, tanggal_pembelian, umur_bulan, umur_ekonomis, nilai_perolehan, nilai_penyusutan, akumulasi_penyusutan, nilai_buku,umur_ekonomis_kapitalisasi,sisa_umur_ekonomis, nilai_kapitalisasi, nilai_penyusutan_baru, nilai_akumulasi_penyusutan_baru)

	select @_id_user, first_day(@_tanggal_penyusutan) as tanggal_penyusutan, A2.kode_jenis,
		id_kib,id_kode_barang,id_kode_lokasi, tanggal_pembelian, umur_bulan,
        umur_ekonomis,
        nilai_perolehan,
        nilai_penyusutan,
        akumulasi_penyusutan,
        nilai_perolehan-akumulasi_penyusutan as nilai_buku,
        penambahan_umur_ekonomis, sisa_umur_ekonomis,
        case when nilai_perolehan <> nilai_perolehan_lama then nilai_kapitalisasi else 0 end as nilai_kapitalisasi,
        (nilai_perolehan-akumulasi_penyusutan)/sisa_umur_ekonomis as nilai_penyusutan_baru,
        akumulasi_penyusutan+((nilai_perolehan-akumulasi_penyusutan)/sisa_umur_ekonomis) as nilai_akumulasi_penyusutan_baru

	from (
		select A1.kode_jenis,id_kib,id_kode_barang,id_kode_lokasi, tanggal_pembelian, umur_bulan,
			umur_ekonomis,penambahan_umur_ekonomis,sisa_umur_ekonomis, nilai_perolehan,
            nilai_perolehan_lama,nilai_kapitalisasi,

        case when umur_bulan <= umur_ekonomis then -- nilai penyusutan
			case when nilai_penyusutan_baru <> 0
				then nilai_penyusutan_baru else nilai_perolehan/umur_ekonomis end
		else 0 end as nilai_penyusutan,

		case when umur_bulan <= umur_ekonomis then -- akumulasi_penyusutan
			case when nilai_akumulasi_penyusutan_baru <> 0
				then nilai_akumulasi_penyusutan_baru else (nilai_perolehan/umur_ekonomis)*umur_bulan end
            else 0 end  as akumulasi_penyusutan
		from (

			select kode_jenis,id_kib,id_kode_barang,id_kode_lokasi, tanggal_pembelian,
				 umur_bulan, umur_ekonomis as umur_ekonomis_lama,
                 umur_ekonomis+penambahan_umur_ekonomis as umur_ekonomis,
                 penambahan_umur_ekonomis,
                 umur_ekonomis+penambahan_umur_ekonomis-umur_bulan as sisa_umur_ekonomis,
                 -- case when nilai_perolehan_lama <> 0 then nilai_perolehan_lama else nilai_perolehan end as nilai_perolehan,
                 nilai_perolehan,
                 nilai_perolehan_lama,
                 nilai_kapitalisasi,
                 nilai_penyusutan_baru,
                 nilai_akumulasi_penyusutan_baru
            from (
				select A.kode_jenis,A.id_kib,A.id_kode_barang,A.id_kode_lokasi, A.tanggal_pembelian,
					TIMESTAMPDIFF(MONTH, first_day(A.tanggal_pembelian),first_day(@_tanggal_penyusutan))+1 AS umur_bulan,
					B.umur_ekonomis,ifnull(C.penambahan_umur_ekonomis,0) as penambahan_umur_ekonomis,
					(A.harga+ifnull(C.nilai_kapitalisasi,0)) as nilai_perolehan,
                    ifnull(C.nilai_kapitalisasi,0) as nilai_kapitalisasi ,
                    D.nilai_perolehan as nilai_perolehan_lama,
                    D.nilai_penyusutan_baru,
                    D.nilai_akumulasi_penyusutan_baru
				from view_kib A
				left join tbl_kode_barang B on A.id_kode_barang=B.id_kode_barang
				left join (
					select id_kode_lokasi, kode_jenis, id_kib,sum(nilai_kapitalisasi) as nilai_kapitalisasi , sum(penambahan_umur_ekonomis) as penambahan_umur_ekonomis
					from tbl_kapitalisasi
					where  first_day(tanggal_kapitalisasi) <= first_day(@_tanggal_penyusutan) -- mengambil nilai kapitalisasi di bulan itu
					group by id_kode_lokasi and kode_jenis, id_kib
				) as C on C.id_kode_lokasi=A.id_kode_lokasi and C.kode_jenis=A.kode_jenis and C.id_kib=A.id_kib

				-- mengambil nilai penyusutan bulan sebelumnya(jika ada)
				left join (
					select A.*
					from tbl_penyusutan A
					left join (
						select id_kode_lokasi,kode_jenis,id_kib,max(umur_bulan) max_umur_bulan
						from tbl_penyusutan
						where  first_day(tanggal_penyusutan) < first_day(@_tanggal_penyusutan)
						group by id_kode_lokasi,kode_jenis,id_kib
					) as B on A.id_kode_lokasi=B.id_kode_lokasi and A.kode_jenis=B.kode_jenis and A.id_kib=B.id_kib
					where A.umur_bulan=B.max_umur_bulan
				) as D on D.id_kode_lokasi=A.id_kode_lokasi and D.kode_jenis=A.kode_jenis and D.id_kib=A.id_kib

				where validasi ="2" and A.status_barang not in ('penghapusan_diterima','terhapus')
					and first_day(A.tanggal_pembelian) <= first_day(@_tanggal_penyusutan)
			) as A11
		) as A1
	) as A2 ;



END ;;
DELIMITER ;
