CREATE  PROCEDURE `proc_rekap_inventaris_objek`(_id_user int,_id_pemilik int,_id_kode_lokasi int, _start_date varchar(20), _last_date varchar(20), _kode_intra_extra varchar(2))
BEGIN
	-- insert filter data kib ke tabel sementara
	call proc_filter_rekap_inventaris(_id_user,_id_pemilik,_id_kode_lokasi, _start_date, _last_date, _kode_intra_extra);

	DROP TEMPORARY TABLE if exists temp_group_by_objek;
	CREATE TEMPORARY TABLE temp_group_by_objek
	select C.id_kode_barang as id_kode_objek, count(*) as total_jumlah, sum(A.harga) as total_harga
	from tbl_temp_rekap_inventaris A
	left join tbl_kode_barang B on A.id_kode_barang = B.id_kode_barang
	left join view_kode_barang_objek C on B.kode_akun = C.kode_akun and B.kode_kelompok = C.kode_kelompok and B.kode_jenis = C.kode_jenis and B.kode_objek = C.kode_objek
    where A.id_user=_id_user
	group by C.id_kode_barang;


	DROP TEMPORARY TABLE if exists temp_group_by_jenis;
