CREATE  PROCEDURE `proc_rekap_penyusutan_objek`(_id_user int,_id_pemilik int,_id_kode_lokasi int, _start_date varchar(20), _last_date varchar(20), _kode_intra_extra varchar(2))
BEGIN
	-- insert filter data kib ke tabel sementara
	call proc_filter_rekap_penyusutan(_id_user,_id_pemilik,_id_kode_lokasi, _start_date, _last_date, _kode_intra_extra);

	DROP TEMPORARY TABLE if exists temp_group_by_objek;
	CREATE TEMPORARY TABLE temp_group_by_objek
	select C.id_kode_barang as id_kode_objek, count(*) as total_jumlah, sum(A.harga) as total_harga, sum(D.nilai_penyusutan) as nilai_penyusutan, sum(D.akumulasi_penyusutan) as akumulasi_penyusutan, sum(D.nilai_buku) as nilai_buku
	from tbl_temp_rekap_penyusutan A
	left join tbl_kode_barang B on A.id_kode_barang = B.id_kode_barang
	left join view_kode_barang_objek C on B.kode_akun = C.kode_akun and B.kode_kelompok = C.kode_kelompok and B.kode_jenis = C.kode_jenis and B.kode_objek = C.kode_objek
	left join (
		SELECT *
		FROM tbl_penyusutan
		where 	month(tanggal_penyusutan) =case when _last_date<>'' then month(_last_date) else month(current_date) end
				and year(tanggal_penyusutan) =case when _last_date<>'' then year(_last_date) else year(current_date) end
	) as D on A.kode_jenis=D.kode_jenis and A.id_kib=D.id_kib
    where A.id_user=_id_user
	group by C.id_kode_barang;

