    where A.id_user=_id_user
	group by C.id_kode_barang;



	SELECT 1 as 'status', A.id_kode_barang ,
		'' as no, concat_ws('.',kode_akun, kode_kelompok) as jenis,
		'' as objek, nama_barang, ifnull(B.total_jumlah,0)total_jumlah, ifnull(B.total_harga,0) total_harga,
		ifnull(B.nilai_penyusutan,0) as nilai_penyusutan,ifnull(B.akumulasi_penyusutan,0) as akumulasi_penyusutan,ifnull(B.akumulasi_penyusutan,0) as nilai_buku,
        '' keterangan
	FROM view_kode_barang_kelompok A
	left join temp_group_by_kelompok B on A.id_kode_barang=B.id_kode_kelompok
