	SELECT 1 as 'status', A.id_kode_barang ,
		'' as no, concat_ws('.',kode_akun, kode_kelompok) as objek,
		'' as rincian_objek, nama_barang, ifnull(B.total_jumlah,0)total_jumlah, ifnull(B.total_harga,0) total_harga,
        ifnull(B.nilai_penyusutan,0) as nilai_penyusutan,ifnull(B.akumulasi_penyusutan,0) as akumulasi_penyusutan,ifnull(B.akumulasi_penyusutan,0) as nilai_buku,
        '' keterangan
	FROM view_kode_barang_kelompok A
	left join temp_group_by_kelompok B on A.id_kode_barang=B.id_kode_kelompok
	where A.kode_kelompok=3
	union all
	SELECT 2 as 'status', A.id_kode_barang as id_kode_jenis ,
		A.kode_jenis as no, concat_ws('.',kode_akun, kode_kelompok, kode_jenis) as objek,
		'' as rincian_objek, nama_barang, ifnull(B.total_jumlah,0)total_jumlah, ifnull(B.total_harga,0) total_harga,
        ifnull(B.nilai_penyusutan,0) as nilai_penyusutan,ifnull(B.akumulasi_penyusutan,0) as akumulasi_penyusutan,ifnull(B.akumulasi_penyusutan,0) as nilai_buku,
        '' keterangan
	FROM view_kode_barang_jenis A
	left join temp_group_by_jenis B on A.id_kode_barang=B.id_kode_jenis
	where A.kode_kelompok=3
	union all
	SELECT 3 as 'status', A.id_kode_barang as id_kode_objek ,
		'' as no, concat_ws('.',kode_akun, kode_kelompok, kode_jenis, kode_objek) as objek,
		'' as rincian_objek, nama_barang, ifnull(B.total_jumlah,0)total_jumlah, ifnull(B.total_harga,0) total_harga,
		ifnull(B.nilai_penyusutan,0) as nilai_penyusutan,ifnull(B.akumulasi_penyusutan,0) as akumulasi_penyusutan,ifnull(B.akumulasi_penyusutan,0) as nilai_buku,
        '' keterangan
	FROM view_kode_barang_objek A
	left join temp_group_by_objek B on A.id_kode_barang=B.id_kode_objek
	where A.kode_kelompok=3
	union all
	SELECT 4 as 'status', A.id_kode_barang as id_kode_rincian_objek ,
		'' as no, concat_ws('.',kode_akun, kode_kelompok, kode_jenis, kode_objek) as objek,
		kode_rincian_objek as rincian_objek, nama_barang, ifnull(B.total_jumlah,0)total_jumlah, ifnull(B.total_harga,0) total_harga,
        ifnull(B.nilai_penyusutan,0) as nilai_penyusutan,ifnull(B.akumulasi_penyusutan,0) as akumulasi_penyusutan,ifnull(B.akumulasi_penyusutan,0) as nilai_buku,
        '' keterangan
	FROM view_kode_barang_rincian_objek A
	left join temp_group_by_rincian_objek B on A.id_kode_barang=B.id_kode_rincian_objek
	where A.kode_kelompok=3



	order by objek,status, rincian_objek asc;


END ;;
DELIMITER ;
