CREATE  PROCEDURE `proc_set_status_barang_kib`(kode_jenis varchar(2), id_kib int, _desc varchar(25))
BEGIN

	if kode_jenis = 1 then
		UPDATE tbl_kib_a A
		SET status_barang=_desc
		WHERE  A.id_kib_a=id_kib;
    elseif kode_jenis = 2 then
		UPDATE tbl_kib_b A
		SET status_barang=_desc
		WHERE  A.id_kib_b=id_kib;
    elseif kode_jenis = 3 then
		UPDATE tbl_kib_c A
		SET status_barang=_desc
		WHERE  A.id_kib_c=id_kib;
    elseif kode_jenis = 4 then
		UPDATE tbl_kib_d A
		SET status_barang=_desc
		WHERE  A.id_kib_d=id_kib;
    elseif kode_jenis = 5 then
		UPDATE tbl_kib_e A
		SET status_barang=_desc
		WHERE  A.id_kib_e=id_kib;
    /*elseif kode_jenis = 6 then
		UPDATE tbl_kib_a A
		SET status_barang=_desc
		WHERE A.kode_jenis=kode_jenis and A.id_kib_a=id_kib;*/
    end if;


END ;;
