CREATE  PROCEDURE `validasi`(kode_jenis varchar(2), id_kib text)
BEGIN
  DECLARE done BOOLEAN DEFAULT FALSE;
  DECLARE _id_kib BIGINT UNSIGNED;
  DECLARE _id_kode_lokasi BIGINT UNSIGNED;
  DECLARE _id_kode_barang BIGINT UNSIGNED;
  DECLARE _tanggal_perolehan varchar(50);
  DECLARE _nomor_register_old varchar(5);
  DECLARE _kib_f varchar(1);

  DECLARE cur CURSOR FOR
	  SELECT A.id_kib -- , id_kode_lokasi, id_kode_barang, tanggal_perolehan, nomor_register
	  FROM view_kib A
	  WHERE A.kode_jenis=kode_jenis and find_in_set(A.id_kib, id_kib);
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done := TRUE;

  OPEN cur;

  validasiLoop: LOOP
    FETCH cur INTO _id_kib;
    IF done THEN
      LEAVE validasiLoop;
    END IF;

	SELECT id_kode_lokasi, id_kode_barang, tanggal_perolehan, nomor_register, kib_f INTO _id_kode_lokasi, _id_kode_barang, _tanggal_perolehan, _nomor_register_old,_kib_f
	FROM view_kib A
	WHERE A.kode_jenis=kode_jenis and A.id_kib=_id_kib;

	-- select _id_kib, _id_kode_lokasi, _id_kode_barang, _tanggal_perolehan,_nomor_register_old, get_register(_id_kode_lokasi,_id_kode_barang, year(_tanggal_perolehan));
    set @sql = '';
    set @tabel='';
    set @id='';
    set @column='';
	set @tabel_histori='';
	if kode_jenis = 1 then
		set @tabel='tbl_kib_a';
        set @id='id_kib_a';
        set @tabel_histori='tbl_kib_a_histori';
        set @column='id_kib_a,id_pemilik,id_kode_barang,id_kode_lokasi,nama_barang,kode_barang,nomor_register,luas,tahun_pengadaan,letak_alamat,status_hak,sertifikat_tanggal,sertifikat_nomor,penggunaan,asal_usul,harga,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,created_at,updated_at';
    elseif kode_jenis = 2 then
		set @tabel='tbl_kib_b';
        set @id='id_kib_b';
        set @tabel_histori='tbl_kib_b_histori';
        set @column='id_kib_b,id_pemilik,id_kode_barang,id_kode_lokasi,kode_barang,nama_barang,nomor_register,merk_type,ukuran_cc,bahan,tahun_pembelian,nomor_pabrik,nomor_rangka,nomor_mesin,nomor_polisi,nomor_bpkb,asal_usul,harga,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,input_banyak,created_at,updated_at';
    elseif kode_jenis = 3 then
		set @tabel='tbl_kib_c';
        set @id='id_kib_c';
        set @tabel_histori='tbl_kib_c_histori';
        set @column='id_kib_c,id_pemilik,id_kode_barang,id_kode_lokasi,nama_barang,kode_barang,nomor_register,kondisi_bangunan,bangunan_bertingkat,bangunan_beton,luas_lantai_m2,lokasi_alamat,gedung_tanggal,gedung_nomor,luas_m2,status,nomor_kode_tanah,asal_usul,harga,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,created_at,updated_at';
    elseif kode_jenis = 4 then
		set @tabel='tbl_kib_d';
        set @id='id_kib_d';
        set @tabel_histori='tbl_kib_d_histori';
        set @column='id_kib_d,id_pemilik,id_kode_barang,id_kode_lokasi,nama_barang,kode_barang,nomor_register,konstruksi,panjang_km,lebar_m,luas_m2,letak_lokasi,dokumen_tanggal,dokumen_nomor,status_tanah,kode_tanah,asal_usul,harga,kondisi,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,created_at,updated_at';
    elseif kode_jenis = 5 then
		set @tabel='tbl_kib_e';
        set @id='id_kib_e';
        set @tabel_histori='tbl_kib_e_histori';
        set @column='id_kib_e,id_pemilik,id_kode_barang,id_kode_lokasi,nama_barang,kode_barang,nomor_register,judul_pencipta,spesifikasi,kesenian_asal_daerah,kesenian_pencipta,kesenian_bahan,hewan_tumbuhan_jenis,hewan_tumbuhan_ukuran,jumlah,tahun_pembelian,asal_usul,harga,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,input_banyak,created_at,updated_at';
    elseif kode_jenis = 6 then
		set @tabel='tbl_kib_f';
        set @id='id_kib_f';
        set @tabel_histori='tbl_kib_f_histori';
        set @column='id_kib_f,id_pemilik,id_kode_barang,id_kode_lokasi,kode_barang,nama_barang,bangunan,kontruksi_bertingkat,kontruksi_beton,luas_m2,lokasi_alamat,dokumen_tanggal,dokumen_nomor,tanggal_mulai,status_tanah,nomor_kode_tanah,asal_usul,nilai_kontrak,keterangan,kode_lokasi,tanggal_transaksi,nomor_transaksi,tanggal_pembelian,tanggal_perolehan,validasi,reject_note,referensi_id,created_at,updated_at';
    end if;


	set @column1=concat_ws(',',@column,'status_histori');
    set @column2=concat_ws(',',@column,'"validasi"');

	set @sql = concat(' INSERT INTO ',@tabel_histori,' ( ',@column1,' ) ');
	set @sql = concat(@sql,' SELECT ',@column2 );
	set @sql = concat(@sql,' FROM ',@tabel);
	set @sql = concat(@sql,' WHERE ',@id,' = ',_id_kib,';');

	PREPARE stmt FROM @sql;
	EXECUTE stmt;

	set @sql = '';
	set @sql = concat('update ',@tabel,' A '); -- jika belum mempunyai nomor register
    if _kib_f='1' then
		if _nomor_register_old = '00000' then
			set @sql = concat(@sql,' set nomor_register = get_register(',_id_kode_lokasi,',',_id_kode_barang,', year("',_tanggal_perolehan,'") ), validasi=2 ' );
		 elseif _nomor_register_old <> '00000' then
			set @sql = concat(@sql,' set validasi=2 ' ); -- jika sudah mempunyai nomor register
		 end if;
     elseif _kib_f='2' then
		set @sql = concat(@sql,' set validasi=2 ' );
     end if;

    set @sql = concat(@sql,'where A.',@id,' = ',_id_kib,';');

	PREPARE stmt FROM @sql;
	EXECUTE stmt;

	-- update histori barang
	call proc_histori_barang('entri', _id_kode_lokasi, kode_jenis, _id_kib);

  END LOOP;

  CLOSE cur;

  SELECT A.id_kib, nomor_register , validasi, A.kode_jenis, A.id_kode_lokasi
  FROM view_kib A
  WHERE A.kode_jenis=kode_jenis and find_in_set(A.id_kib, id_kib);


END ;;
